import React from "react";
import { Link } from "react-router-dom";

export default function AdminLayout() {
  return (
    <div style={{ padding: 20 }}>
      <h2>Admin Dashboard âœ…</h2>
      <p>Select a section:</p>

      <div style={{ display: "flex", gap: 10, flexWrap: "wrap" }}>
        <Link to="/admin/users"><button>Users</button></Link>
        <Link to="/admin/orders"><button>Orders</button></Link>
        <Link to="/admin/categories"><button>Categories</button></Link>
        <Link to="/admin/messages"><button>Messages</button></Link>
        <Link to="/admin/repairs"><button>Repairs</button></Link>
        <Link to="/admin/admins"><button>Admins</button></Link>
      </div>

      <p style={{ marginTop: 16 }}>
        If you see this, <b>/admin</b> route is working.
      </p>
    </div>
  );
}
